import './Home.css'
import profilePic from './github_profile.png'

function Home() {
  return (
    <section id='home'>
      <div id='presentationElements'>
        <div className='roundedContainer'>
          <img src={profilePic} alt='Profile Image' width='200' height='200'/>
        </div>
      </div>
    </section>
  )
}

export default Home;
